import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Detail from './routes/Detail';
import Home from './routes/Home';

function App() {
  return (
          <Router>
            <Switch>
              <Route path="/movie/:id">
                <Detail />
              </Route>
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/hello" >
                <h1>Hello</h1>
              </Route>
              <Route path="/about-us">
                <h1>About us</h1>
              </Route>
            </Switch>
         </Router>)
}

export default App;
